    <title>map</title>

    <style>
      .two {
  transition: all 2s ease-in-out 0.5s;
  -webkit-transition: all 2s ease-in-out 0.5s;
}
#scale {
  height: 150px;
  width: 100px;
  text-align: center;
  margin: 0 auto;
}
#scale {
  fill: yellow;
  stroke: blue;
  stroke-width: 2px;
}
.grow:hover {
  transform: scale(2.0);
  -ms-transform: scale(2.0);
  -webkit-transform: scale(2.0);
}
      .map-container {
        max-width: 50%;
        position: relative;
      }
      .map-container .map {
        width: 100%;
      }
      .map-marker {
        display: inline-flex;
        align-items: center;
        justify-content: center;
        opacity: 0.5;
        position: absolute;
        transition: all 0.3s ease-in-out;
      }
      .map path{
        transition: all 0.3s ease-in-out;
      }
      .map path.active-state {
        fill: #93c1de;
        transform: translate3d(-4px, -4px, 0px);
      }
      .map-marker.active-marker {
        opacity: 1;
        transform: scale(1.6);
      }
      .map-marker[data-location="mumbai"] {
        left: 21%;
        top: 49%;
      }
      .map-marker[data-location="pune"] {
        left: 19%;
        top: 52%;
      }
      .map-marker[data-location="jaipur"] {
        left: 42%;
        top: 28%;
      }
      .map-marker[data-location="kolkata"] {
        left: 62%;
        top: 71%;
      }
      .map-section__wraper {
        display: flex;
        justify-content: space-between;
      }
      .state-card {
        width: 398px;
        height: auto;
        background: #dbf2ff;
        padding: 41px 40px 30px;
      }
      .state-card__wraper {
        background: #fff;
        padding: 30px 24px 21px;
      }
    </style>

    <script src="assets/js/jquery.min.js"></script>
    <script type="text/javascript">
      //loop 
      var locations = [];
      i = 0;
      $('.map path[data-location]').each(function($i, $item) {
          $state = $item.dataset["state"];
          $location = $item.dataset["location"].split(',');
          locations[i++] = $location;
      });
      var allLocations = locations.flat(Infinity);

      //select random location
      var autoplayInterval = window.setInterval(function(){
        var randomLocation = allLocations[Math.floor(Math.random()*allLocations.length)];
        //title
        $state_location = randomLocation;
        $state_location_print = $(".state-card .title");
        $state_location_print.text($state_location);
        //marker
        $(".map-container").find(".map-marker").removeClass("active-marker");
        $(".map-container").find($(".map-marker[data-location*="+$state_location+"]")).addClass("active-marker");
        //state color
        $(".map").find("path").removeClass("active-state");
        $(".map").find($("[data-location*="+$state_location+"]")).addClass("active-state");
      }, 5000);
      //click
      $(".map-marker").click(function () {
        //clearInterval(autoplayInterval);
        $(".map-container").find(".map-marker").removeClass("active-marker");
        $(this).addClass("active-marker");
        //title
        $state_location = $(this).attr("data-location");
        $state_location_print = $(".state-card .title");
        $state_location_print.text($state_location);
        //state color
        $state = $(this).attr("data-state");
        $(".map").find("path").removeClass("active-state");
        $(".map").find($("[data-state="+$state+"]")).addClass("active-state");
      });
    </script>
